 * Main function
 * For details, see function tagPackageURIPrefixes in class SharedFunctions
 */

function mainMethod()
{
	var treeSelectedType = Repository.GetTreeSelectedItemType();
	if(treeSelectedType != otPackage)
	{
		Session.Prompt("This script only supports packages", promptOK);
		return;
	}
	var package = Repository.GetTreeSelectedPackage();
	tagPackageURIPrefixes(package);
	var projectInterface = Repository.GetProjectInterface();
	synchronizePackage(projectInterface, package);
	Session.Prompt("Script \"5: Autofill URI and assign prefixes\" finished running", promptOK);
}

//Run the method
mainMethod();

