/**
 * Modifies the tagged values of a package and its child objects with name
 * "prefLabel (da)" or "prefLabel (en)", depending on language.
 * The value of each prefLabel (da) or prefLabel (en) is set
 * to the stripped name (no prefix) of the parent object
 * @function tagPackageName
 * @param {Package} package - The package to modify.
 * @param {string} lang - The language of the prefLabel to modify, (da) or (en).
 */

function tagPackageName(package, lang)
{
	//Create variables to hold the names of the tagged values to modify
	//and set their value to match the parameter language
	var prefLabelName = "prefLabel " + lang;
	var labelName = "label " + lang;
	var replaceExisting = true;

	//Modify tagged values in package
	var packageElement = package.element;
	var packageName = packageElement.name;
	setTaggedValue(packageElement, labelName, stripName(packageName), replaceExisting);

	//Modify tagged values in child packages by calling function recursively
	var packages = package.packages;
	for(var i = 0; i < packages.count; i++)
	{
		tagPackageName(packages.getat(i), lang);
	}

	//Modify tagged values in child elements
	var elements = package.elements;
	for(var i = 0; i < elements.count; i++)
	{
		var element = elements.getat(i);
		var elementName = element.name;
		setTaggedValue(element, prefLabelName, stripName(elementName), replaceExisting);

		//Modify tagged values in child attributes of each element
		var elementAttributes = element.attributes;
		for(var j = 0; j < elementAttributes.count; j++)
		{
			var attribute = elementAttributes.getAt(j);
			var attributeName = attribute.name;
			setTaggedValue(attribute, prefLabelName, stripName(attributeName), replaceExisting);
		}

		//Modify tagged values in child connector ends of each element

		var elementConnectors = element.connectors;
		for(var j = 0; j < elementConnectors.count; j++)
		{
			var connector = elementConnectors.getAt(j);
			var clientEnd = connector.clientEnd;
			var supplierEnd = connector.supplierEnd;
			if(clientEnd.role != "")
			{
				var clientEndName = clientEnd.role;
				setTaggedValue(clientEnd, prefLabelName, stripName(clientEndName), replaceExisting);
			}
			if(supplierEnd.role != "")
			{
				var supplierEndName = supplierEnd.role;
				setTaggedValue(supplierEnd, prefLabelName, stripName(supplierEndName), replaceExisting);
			}
		}
	}	
}

/**
 * Modifies the tagged values of a package and its child objects with name
 * "prefLabel (da)" or "prefLabel (en)", depending on language.
 * The value of each prefLabel (da) or prefLabel (en) is set
 * to the stripped alias (no prefix) of the parent object
 * @function tagPackageAlias
 * @param {Package} package - The package to modify.
 * @param {string} lang - The language of the prefLabel to modify, (da) or (en).
 */

function tagPackageAlias(package, lang)
{
	//Create variables to hold the names of the tagged values to modify
	//and set their value to match the parameter language
	var labelName = "label " + lang;	
	var aliasName = "prefLabel " + lang;
	var replaceExisting = true;

	//Modify tagged values in package
	var packageElement = package.element;
	var packageAlias = packageElement.alias;
	setTaggedValue(packageElement, labelName, stripName(packageAlias), replaceExisting);

	//Modify tagged values in child packages by calling function recursively
	var packages = package.packages;
	for(var i = 0; i < packages.count; i++)
	{
		tagPackageAlias(packages.getat(i), lang);
	}

	//Modify tagged values in child elements
	var elements = package.elements;
	for(var i = 0; i < elements.count; i++)
	{
		var element = elements.getat(i);
		var elementAlias = element.alias;
		setTaggedValue(element, aliasName, stripName(elementAlias), replaceExisting);

		//Modify tagged values in child attributes of each element
		var elementAttributes = element.attributes;
		for(var j = 0; j < elementAttributes.count; j++)
		{
			var attribute = elementAttributes.getAt(j);
			var attributeAlias = attribute.alias;
			setTaggedValue(attribute, aliasName, stripName(attributeAlias), replaceExisting);
		}

		//Modify tagged values in child connector ends of each element
		var elementConnectors = element.connectors;
		for(var j = 0; j < elementConnectors.count; j++)
		{
			var connector = elementConnectors.getat(j);
			var clientEnd = connector.clientend;
			var supplierEnd = connector.supplierend;
			if(clientEnd.role != "")
			{
				var clientEndAlias = clientEnd.Alias;
				setTaggedValue(clientEnd, aliasName, stripName(clientEndAlias), replaceExisting);
			}
			if(supplierEnd.role != "")
			{
				var supplierEndAlias = supplierEnd.Alias;
				setTaggedValue(supplierEnd, aliasName, stripName(supplierEndAlias), replaceExisting);
			}
		}
	}	
}

/**
 * Modifies the tagged values of a package and its child objects with name
 * "definition (da)" or "definition (en)", depending on language.
 * The value of each definition (da) or definition (en) is set to "<memo>". 
 * The notes of each definition (da) or definition (en) is
 * set to the notes of the parent object
 * @function tagPackageNotes
 * @param {Package} package - The package to modify.
 * @param {string} lang - The language of the definition to modify, (da) or (en).
 */

function tagPackageNotes(package, lang)
{
	//Create variable to hold the name of the tagged value to modify
	//and set their value to match the parameter language
	var notesName = "definition " + lang;
	var replaceExisting = true;

	//Modify tagged values in child packages by calling function recursively
	var packages = package.packages;
	for(var i = 0; i < packages.count; i++)
	{
		tagPackageNotes(packages.getat(i), lang);
	}

	//Modify tagged values in child elements
	var elements = package.elements;
	for(var i = 0; i < elements.count; i++)
	{
		var element = elements.getat(i);
		var elementNotes = element.notes;
		Session.Output("Tagging element: " + element.name + ", elementNotes: " + elementNotes);
		setTaggedValue(element, notesName, "<memo>", replaceExisting);
		setTaggedValueNotes(element, notesName, elementNotes);

		//Modify tagged values in child attributes of each element
		var elementAttributes = element.attributes;
		for(var j = 0; j < elementAttributes.count; j++)
		{
			var attribute = elementAttributes.getAt(j);
			var attributeNotes = attribute.notes;
			setTaggedValue(attribute, notesName, "<memo>", replaceExisting);
			setTaggedValueNotes(attribute, notesName, attributeNotes);
		}

		//Modify tagged values in child connector ends of each element
		var elementConnectors = element.connectors;
		for(var j = 0; j < elementConnectors.count; j++)
		{
			var connector = elementConnectors.getat(j);
			var clientEnd = connector.clientend;
			var supplierEnd = connector.supplierend;
			if(clientEnd.role != "")
			{
				var clientEndNotes = clientEnd.rolenotes;
				setTaggedValue(clientEnd, notesName, "<memo>$ea_notes=" + clientEndNotes, replaceExisting);
				//setTaggedValueNotes(clientEnd, notesName, clientEndNotes);
			}
			if(supplierEnd.role != "")
			{
				var supplierEndNotes = supplierEnd.rolenotes;
				setTaggedValue(supplierEnd, notesName, "<memo>$ea_notes=", replaceExisting);
				//setTaggedValueNotes(supplierEnd, notesName, supplierEndNotes);
			}
		}
	}
}

/**
 * Modifies the tagged values of a package and its child objects with name "URI".
 * The value of each "URI" is set to the value of tagged value "namespace"
 * of the objects parent package concatenated with the objects stripped name
 *
 * Also changes the name of every object to be prefixed by the value of
 * tagged value "namespacePrefix" of the objects parent package.
 * @function tagPackageURIPrefixes
 * @param {Package} package - The package to modify.
 */

function tagPackageURIPrefixes(package)
{
	var elements = package.elements;
	var packages = package.packages;
	var packageNamespace = getTaggedValue(package.element, "namespace", "");
	var packageNamespacePrefix = getTaggedValue(package.element, "namespacePrefix", "");

	//Modify tagged values in child packages by calling function recursively
	for(var i = 0; i < packages.count; i++)
	{
		tagPackageURIPrefixes(packages.getAt(i));
	}

	//Modify tagged values in child elements
	for(var i = 0; i < elements.count; i++)
	{
		var element = elements.getat(i);
		setURI(element, package);
		addPrefix(element, packageNamespacePrefix);

		//Modify tagged values in child attributes of each element
		var elementAttributes = element.attributes;
		for(var j = 0; j < elementAttributes.count; j++)
		{
			var attribute = elementAttributes.getAt(j);
			setURI(attribute, package);
			addPrefix(attribute, packageNamespacePrefix);
		}

		//Modify tagged values in child connector ends of each element
		var elementConnectors = element.connectors;
		for(var j = 0; j < elementConnectors.count; j++)
		{
			var connector = elementConnectors.getat(j);
			var clientEnd = connector.clientend;
			var supplierEnd = connector.supplierend;
			if(clientEnd.role != "")
			{
				setURI(clientEnd, package);
				addPrefix(clientEnd, packageNamespacePrefix);
			}
			if(supplierEnd.role != "")
			{
				setURI(supplierEnd, package);
				addPrefix(supplierEnd, packageNamespacePrefix);
			}
		}
	}
}

/**
 * Creates new "subClassOf" tagged values for every element in a package and child packages.
 * The value of each subClassOf is set to the value of tagged value "URI"
 * of the source element of a connector end with type "Generalization"
 * where the element with tagged values to be modified is the target.
 * @function tagPackageSubClassOf
 * @param {Package} package - The package to modify.
 */

function tagPackageSubClassOf(package)
{
	var replaceExisting = false;

	//Modify tagged values in child packages by calling function recursively
	var packages = package.packages;
	for(var i = 0; i < packages.count; i++)
	{
		tagPackageSubClassOf(packages.getAt(i));
	}

	//Iterate through package elements
	var elements = package.elements;
	for(var i = 0; i < elements.count; i++)
	{
		var element = elements.getat(i);
		var connectors = element.connectors;
		//Iterate through element connectors
		for(var j = 0; j < connectors.count; j++)
		{
			//Check if current connector is of type "Generalization"
			//and that the current element is the target of the connector end
			var connector = connectors.getat(j);
			var clientID = connector.clientID;
			if(connector.type == "Generalization" && clientID == element.elementID)
			{
				//Retrieve source element from repository and find the value of its tagged value with name "URI"
				//If tagged value exists and value is not "", and target element does not have
				//a tagged value with name "subClassOf" and this value, add it
				var supplierID = connector.supplierID;
				var supplierElement = Repository.GetElementByID(supplierID);
				var supplierElementURI = getTaggedValue(supplierElement, "URI", "");
				if(supplierElementURI != "" && !taggedValueValueExists(element, "subClassOf", supplierElementURI))
				{
					setTaggedValue(element, "subClassOf", supplierElementURI, replaceExisting);
				}
			}
		}
	}
}

/**
 * Adds or modifies a tagged value with with name "URI".
 * Value is set to the value of tagged value "namespace" of the objects parent package,
 * concatenated with the stripped version of the objects name.
 * @function setURI
 * @param {Object} object - The object to be modified.
 * @param {String} package - The package containing the object. Used to find namespace of object.
 */

function setURI(object, package)
{
	var namespace = getTaggedValue(package.element, "namespace", "");
	var namespacePrefix = getTaggedValue(package.element, "namespacePrefix", "")
	var replaceExisting = true;
	var URI;
	//Retrieve object name and, if it exists, the prefix-part of its name
	//prefixArray contains every match of a prefix (i.e. any number of characters followed by a semicolon)
	//The array is expected to either have value null (i.e. no matches) or an array containing one element (one match found)
	var objectName = (object.objectType == otConnectorEnd) ? object.role : object.name;
	var objectNamePrefixArray = objectName.match(/^.*:/);

	//Check if the object name is prefixed
	//If objectNamePrefixArray == null, no prefix exists, and URI can be set to namespace + object name
	if (objectNamePrefixArray == null)
	{
		URI = namespace + objectName;
		setTaggedValue(object, "URI", URI, replaceExisting);
		return;
	}


	//If prefix exists, check if prefix matches the value of "namespacePrefix" of parent package
	//If it does, set the value of tagged value "URI" to the namespace + the stripped version of object name
	var objectNamePrefix = objectNamePrefixArray[0];
	//Trim ":" from prefix
	objectNamePrefix = objectNamePrefix.substring(0, objectNamePrefix.length-1);

	if(namespacePrefix == objectNamePrefix)
	{
		var objectNameStripped = stripPrefix(objectName);
		URI = namespace + objectNameStripped;
		setTaggedValue(object, "URI", URI, replaceExisting);
	}

	//If URI does not match tagged value "namespace" of parent package,
	//the object is foreign and its URI should not be modified
	//If the foreign object is an element, recolor it RGB(234,240,255)
	else if (object.objecttype == otElement )
	{
		var scope = 1; //Modify the element in all diagrams
		var item = 0;  //Modify background color of the element
		var value = 234 + (240<<8) + (255<<16); //Set color to RGB(234,240,255) = 234+(240<<8)+(255<<16)
		object.setAppearance(scope, item, value);
	}
}

/**
 * Modifies the name of an object
 * Name is prefixed with the value of tagged value "namespacePrefix"
 * of parent package concatenated with :
 * @function addPrefix
 * @param {Object} object - The object to be modified
 * @param {string} packagePrefix - The value of tagged value "namespacePrefix" of objects parent package
 */

function addPrefix(object, packagePrefix)
{
	var objectName = (object.objectType == otConnectorEnd) ? object.role : object.name;
	var objectNamePrefixArray = objectName.match(/^.*:/);

	//If package does not have a prefix or object name already has a prefix, do nothing
	if(packagePrefix == "" || packagePrefix == null || objectNamePrefixArray != null) return;

	//Set object name to prefix concatenated with current name
	if(object.objectType == otConnectorEnd) object.role = packagePrefix + ":" + objectName;
	else object.name = packagePrefix + ":" + objectName;
	object.Update();
}

/**
 * Removes the namespace prefix from a string using a regular expression.
 * Removes the first occurence of the character ":" and any characters before it.
 * @function stripPrefix
 * @param {string} objectName - The string to be modified
 * @return {string} - The modified string
 */

function stripPrefix(objectName)
{
	return objectName.replace(/^.*:/, "");
}

/**
 * Removes the namespace prefix from a string and converts camelcase into common lowercase
 * RegEx pattern explained:
 * /../: Indicates start and end of expression
 * ([a-z])([A-Z]): Matches any lowercase letter followed by an uppercase letter and saves them in variables $1 and $2
 * g: Additional parameter to do a global search (i.e. find all matches, rather than stopping after the first match)
 * Replace explained:
 * Matches every lowercase letter followed by an uppercase letter and replaces them with the same letters, but
 * with a space inserted between (e.g. "name" -> "name", but nameName -> name Name)
 * @function stripName
 * @param {string} string - The string to be modified
 * @return {string} - The modified string
 */

function stripName(string)
{
	var re = /([a-z])([A-Z])/g;
	var result = stripPrefix(string).replace(re, '$1 $2').toLowerCase();
	return result;
}

/**
 * If no tagged value with given name exists, adds a new tagged value
 * If a tagged value with given name exists, either modifies the existing tagged value
 * or adds an additional tagged value.
 * Only affects the first occurence of a tagged value with given name
 * @function setTaggedValue
 * @param {Object} object - the object holding the tagged value collection to modify
 * @param {string} taggedValueName - the name of the tagged value to add / modify
 * @param {string} taggedValueValue - the value to be used for the added / modified tagged value
 * @param {boolean} replaceExisting - if a tagged value with name taggedValueName exists,
 * indicates whether the existing tagged value should be modified (false) or if a new tagged value should be added (true)
 */

function setTaggedValue(object, taggedValueName, taggedValueValue, replaceExisting)
{
	if (object == null || taggedValueName.length == "") return;

	var taggedValue;
	var taggedValues = object.taggedValues;
	var _taggedValueName;
	for(var i = 0; i < taggedValues.count; i++)
	{
		_taggedValueName = (object.objectType == otConnectorEnd) ? taggedValues.getAt(i).tag : taggedValues.getAt(i).name;
		if(_taggedValueName == taggedValueName)
		{
			taggedValue = taggedValues.getAt(i);
			break;
		}
	}

	if ( taggedValue == null || (!replaceExisting && !taggedValueValueExists))
	{
		Session.Output("Adding new taggedValue. " + taggedValueName + ", " + taggedValueValue);
		taggedValue = object.TaggedValues.AddNew(taggedValueName, taggedValueValue);
	}
	else taggedValue.Value = taggedValueValue;

	taggedValue.Update();
}

/**
 * Returns the first taggedValue with name taggedValueName
 * @function getTaggedValue
 * @param {Object} object - The object to examine
 * @param {String} taggedValueName - the taggedValue to search for
 * @param {String} defaultValue - the result to return if no matching taggedValue is found
 */
function getTaggedValue(object, taggedValueName, defaultValue)
{
	var result = defaultValue;
	var taggedValue;
	if ( object != null && taggedValueName.length > 0 )
	{
		var taggedValueValue;
		var objectTaggedValues = object.TaggedValues;
		for(var i = 0; i < objectTaggedValues.count; i++)
		{
			if(objectTaggedValues.getat(i).FQname == taggedValueName || objectTaggedValues.getat(i).name == taggedValueName)
			{
				taggedValue = objectTaggedValues.getat(i);
				break; //bad practice
			}
		}
		if ( taggedValue != null ) result = taggedValue.Value;
	}
	return result;	
}

/**
 * Predicate checking if a tagged value with a specific tagged value value
 * can be found in an objects tagged values
 * @function taggedValueValueExists
 * @param {Object} object - The object to examine
 * @param {String} taggedValueName - Only check taggedValue with the passed taggedValueName 
 * @param {String} taggedValueValue - Compare taggedValues with the passed taggedValueValue
 * @return {Boolean} - whether the tagged value exists or not
 */

function taggedValueValueExists(object, taggedValueName, taggedValueValue)
{
	var taggedValues = object.taggedvalues;
	var _taggedValueName = "";
	var _taggedValueValue = "";
	for(var i = 0; i < taggedValues.count; i++)
	{
		_taggedValueName = taggedValues.getat(i).name;
		_taggedValueValue = taggedValues.getat(i).value;
		if(_taggedValueName == taggedValueName && _taggedValueValue == taggedValueValue)
		{
			return true;
		}
	}
	return false;
}

/**
 * Modifies the notes of every tagged value with a given name
 * Not yet implemented for connector ends, due to RoleTag storing notes in RoleTag.Value
 * @function setTaggedValueNotes
 * @param {Object} object - The object to modify
 * @param {String} taggedValueName - the taggedValue to modify. If multiple exist, all are modified
 * @param {String} taggedValueNotes - the notes to insert
 */

function setTaggedValueNotes(object, taggedValueName, taggedValueNotes)
{
	if(object.objectType == otConnectorEnd) return;

	var taggedValues = object.taggedvalues;
	var taggedValue;
	for(var i = 0; i < taggedValues.count; i++)
	{
		taggedValue = taggedValues.getat(i);
		if(taggedValue.name == taggedValueName)
		{
			taggedValue.Notes = taggedValueNotes;
			taggedValue.Update();
		}
	}
}

/**
 * Updates the Enterprise Architect user interface
 * @function synchronizePackage
 * @param {Project} projectInterface - The Enterprise Architect user interface
 * @param {Package} package - The package to update
 */

function synchronizePackage(projectInterface, package)
{
	var packageGUIDXML = projectInterface.GUIDtoXML(package.packageGUID);
	projectInterface.SynchronizePackage(packageGUIDXML, "children=1"); 
}

/**
 * Prototype function for updating tagged values using SQL queries
 */

function SQLUpdateTaggedValue(table, nameColumn, idColumn, valueColumn, id, taggedValueName, taggedValueValue)
{
	var preparedStatement = "UPDATE " + table + " SET " + valueColumn + " = '" + taggedValueValue + "' WHERE " + idColumn + " = " + id + " AND " + nameColumn + " = '" + taggedValueName + "';";
	Session.Output(preparedStatement);
	Repository.Execute(preparedStatement);
}

!INC Plusprofil, Shared Functions.SharedFunctions
!INC Local Scripts.EAConstants-JScript

/**
 * Main function
 * Copy every tagged value of one object, then paste it in another object,
 * overwriting any existing tagged value with the same name
 */

function mainMethod()
{
	var treeSelectedType = Repository.GetTreeSelectedItemType();
	if(treeSelectedType != otElement && treeSelectedType != otAttribute && treeSelectedType != otPackage)
	{
		Session.Prompt("This script does not support the selected type of object", promptOK);
		return;
	}

	//Retrieve object to copy from, prompt the user to select a new object.
	//then retrieve the object to copy to
	var fromObject = Repository.GetTreeSelectedObject();
	Session.Prompt("Vlg objektet i Project Browser at flytte til, og tryk derefter \"OK\"", promptOK);
	var toObject = Repository.GetTreeSelectedObject();

	//Special case for packages: If a package is selected, 
	//select the package.element instead
	if(fromObject.objectType == otPackage) fromObject = fromObject.element;
	if(toObject.objectType == otPackage) toObject = toObject.element;

	//Retrieve the GUID of fromObject and toObject
	//If object is an element, use ElementGUID. Otherwise, use AttributeGUID
	//Compare the two GUIDs and, if they are the same, print an error and return.
	var fromObjectGUID;
	var toObjectGUID;
	if(fromObject.objectType == otElement) fromObjectGUID = fromObject.elementGUID;
	else fromObjectGUID = fromObject.AttributeGUID;
	if(toObject.objectType == otElement) toObjectGUID = toObject.elementGUID;
	else toObjectGUID = toObject.AttributeGUID;
	if(fromObjectGUID == toObjectGUID)
	{
		Session.Prompt("Invalid parameters.\nMake sure that two different objects have been selected.", promptOK);
		return;
	}

	//Declare variables to hold tagged value name, value, notes and whether to replace existing tagged values
	var taggedValueName;
	var taggedValueValue; 
	var taggedValueNotes;
	var replaceExisting = true;

	//Iterate through every tagged value, copying the name, value and notes,
	//then create a new tagged value with these values
	for(var i = 0; i < fromObject.taggedValues.count; i++)
	{
		taggedValueName = fromObject.taggedValues.getat(i).name;
		taggedValueValue = fromObject.taggedValues.getat(i).value;
		taggedValueNotes = fromObject.taggedValues.getat(i).notes;
		setTaggedValue(toObject, taggedValueName, taggedValueValue, replaceExisting);
		setTaggedValueNotes(toObject, taggedValueName, taggedValueNotes);
	}

	var package = Repository.GetTreeSelectedPackage();
	var projectInterface = Repository.GetProjectInterface();
	synchronizePackage(projectInterface, package);
	Session.Prompt("Script \"4: Copy tags from selected element to another\" finished running", promptOK);

}

//Run the method
mainMethod();
